(14, 1, '2012-12-13 22:12:41', 'Novak1997_CellCycle', 'R37', '<?xml version="1.0" encoding="UTF-8" standalone="no"?>\n<sbml xmlns="http://www.sbml.org/sbml/level2" level="2" metaid="_000000" version="1">\n  <model id="NovakTyson1997CellModel" metaid="_000001" name="Novak1997_CellCycle">\n    <notes>\n      <body xmlns="http://www.w3.org/1999/xhtml">\n      <p>\n      This a model from the article:\n      <br/>\n      <strong> Modeling the control of DNA replication in fission yeast. \n</strong>\n      <br/>\nNovak B, Tyson JJ \n      <em>Proc. Natl. Acad. Sci. U.S.A.</em>1997:94(17):9147-52\n      <a href="http://www.ncbi.nlm.nih.gov/pubmed/9256450">9256450</a>,\n      <br/>\n      <strong>Abstract:</strong>\n      <br/>\nA central event in the eukaryotic cell cycle is the decision to commence DNA replication (S phase). Strict controls normally operate to prevent repeated rounds of DNA replication without intervening mitoses ("endoreplication") or initiation of mitosis before DNA is fully replicated ("
mitotic catastrophe"). Some of the genetic interactions involved in these controls have recently been identified in yeast. From this evidence we propose a molecular mechanism of "Start" control in Schizosaccharomyces pombe. Using established principles of biochemical kinetics, we compare the properties of this model in detail with the observed behavior of various mutant strains of fission yeast: wee1(-) (size control at Start), cdc13Delta and rum1(OP) (endoreplication), and wee1(-) rum1Delta (rapid division cycles of diminishing cell size). We discuss essential features of the mechanism that are responsible for characteristic properties of Start control in fission yeast, to expose our proposal to crucial experimental tests.\n   </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href="http://www.ebi.ac.uk/biomodels/legal.html" target="_blank">terms of use</a>.<br/>To 
