(15, 1, '2012-12-13 22:12:51', 'Novak1997_CellCycle', 'R57', '<?xml version="1.0" encoding="UTF-8" standalone="no"?>\n<sbml xmlns="http://www.sbml.org/sbml/level2" level="2" metaid="_000000" version="1">\n  <model id="NovakTyson1997CellModel" metaid="_000001" name="Novak1997_CellCycle">\n    <notes>\n      <body xmlns="http://www.w3.org/1999/xhtml">\n  <p>\n      This a model from the article:\n      <br/>\n        <strong> Modeling the control of DNA replication in fission yeast.\n</strong>\n        <br/>\nNovak B, Tyson JJ\n      <em>Proc. Natl. Acad. Sci. U.S.A.</em>1997:94(17):9147-52\n      <a href="http://www.ncbi.nlm.nih.gov/pubmed/9256450">9256450</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nA central event in the eukaryotic cell cycle is the decision to commence DNA replication (S phase). Strict controls normally operate to prevent repeated rounds of DNA replication without intervening mitoses (&quot;endoreplication&quot;) or initiation of mitosis before DNA is fully 
replicated (&quot;mitotic catastrophe&quot;). Some of the genetic interactions involved in these controls have recently been identified in yeast. From this evidence we propose a molecular mechanism of &quot;Start&quot; control in Schizosaccharomyces pombe. Using established principles of biochemical kinetics, we compare the properties of this model in detail with the observed behavior of various mutant strains of fission yeast: wee1(-) (size control at Start), cdc13Delta and rum1(OP) (endoreplication), and wee1(-) rum1Delta (rapid division cycles of diminishing cell size). We discuss essential features of the mechanism that are responsiblefor characteristic properties of Start control in fission yeast, to expose our proposal to crucial experimental tests.\n   </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href="http://www.ebi.ac.uk/biomodels/legal.html" target="_
blank">terms of use</a>.<br/>To cite BioModels Database, please use <a href="http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960" target="_blank"> Le NovÃ¨re N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>\n    </body>\n  </notes>\n  <annotation>\n    <rdf:RDF xmlns:bqbiol="http://biomodels.net/biology-qualifiers/" xmlns:bqmodel="http://biomodels.net/model-qualifiers/" xmlns:dc="http://purl.org/dc/elements/1.1/" xmlns:dcterms="http://purl.org/dc/terms/" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" xmlns:vCard="http://www.w3.org/2001/vcard-rdf/3.0#">\n      <rdf:Description rdf:about="#_000001">\n        <dc:creator rdf:parseType="Resource">\n          <rdf:Bag>\n            <rdf:li rdf:
